        public void AddCallbacks(IConduciendoActions instance)
        {
            if (instance == null || m_Wrapper.m_ConduciendoActionsCallbackInterfaces.Contains(instance)) return;
            m_Wrapper.m_ConduciendoActionsCallbackInterfaces.Add(instance);
            @MovimientoLateral.started += instance.OnMovimientoLateral;
            @MovimientoLateral.performed += instance.OnMovimientoLateral;
            @MovimientoLateral.canceled += instance.OnMovimientoLateral;
            @MovimientoFrontal.started += instance.OnMovimientoFrontal;
            @MovimientoFrontal.performed += instance.OnMovimientoFrontal;
            @MovimientoFrontal.canceled += instance.OnMovimientoFrontal;
            @Accion.started += instance.OnAccion;
            @Accion.performed += instance.OnAccion;
            @Accion.canceled += instance.OnAccion;
            @AbrirInventario.started += instance.OnAbrirInventario;
            @AbrirInventario.performed += instance.OnAbrirInventario;
            @AbrirInventario.canceled += instance.OnAbrirInventario;
            @Luces.started += instance.OnLuces;
            @Luces.performed += instance.OnLuces;
            @Luces.canceled += instance.OnLuces;
            @Derrape.started += instance.OnDerrape;
            @Derrape.performed += instance.OnDerrape;
            @Derrape.canceled += instance.OnDerrape;
            @Mirar.started += instance.OnMirar;
            @Mirar.performed += instance.OnMirar;
            @Mirar.canceled += instance.OnMirar;
            @Pausa.started += instance.OnPausa;
            @Pausa.performed += instance.OnPausa;
            @Pausa.canceled += instance.OnPausa;
            @Pito.started += instance.OnPito;
            @Pito.performed += instance.OnPito;
            @Pito.canceled += instance.OnPito;
            @Foto.started += instance.OnFoto;
            @Foto.performed += instance.OnFoto;
            @Foto.canceled += instance.OnFoto;
        }

        private void UnregisterCallbacks(IConduciendoActions instance)
        {
            @MovimientoLateral.started -= instance.OnMovimientoLateral;
            @MovimientoLateral.performed -= instance.OnMovimientoLateral;
            @MovimientoLateral.canceled -= instance.OnMovimientoLateral;
            @MovimientoFrontal.started -= instance.OnMovimientoFrontal;
            @MovimientoFrontal.performed -= instance.OnMovimientoFrontal;
            @MovimientoFrontal.canceled -= instance.OnMovimientoFrontal;
            @Accion.started -= instance.OnAccion;
            @Accion.performed -= instance.OnAccion;
            @Accion.canceled -= instance.OnAccion;
            @AbrirInventario.started -= instance.OnAbrirInventario;
            @AbrirInventario.performed -= instance.OnAbrirInventario;
            @AbrirInventario.canceled -= instance.OnAbrirInventario;
            @Luces.started -= instance.OnLuces;
            @Luces.performed -= instance.OnLuces;
            @Luces.canceled -= instance.OnLuces;
            @Derrape.started -= instance.OnDerrape;
            @Derrape.performed -= instance.OnDerrape;
            @Derrape.canceled -= instance.OnDerrape;
            @Mirar.started -= instance.OnMirar;
            @Mirar.performed -= instance.OnMirar;
            @Mirar.canceled -= instance.OnMirar;
            @Pausa.started -= instance.OnPausa;
            @Pausa.performed -= instance.OnPausa;
            @Pausa.canceled -= instance.OnPausa;
            @Pito.started -= instance.OnPito;
            @Pito.performed -= instance.OnPito;
            @Pito.canceled -= instance.OnPito;
            @Foto.started -= instance.OnFoto;
            @Foto.performed -= instance.OnFoto;
            @Foto.canceled -= instance.OnFoto;
