        public void RemoveCallbacks(IConduciendoActions instance)
        {
            if (m_Wrapper.m_ConduciendoActionsCallbackInterfaces.Remove(instance))
                UnregisterCallbacks(instance);
        }

        public void SetCallbacks(IConduciendoActions instance)
        {
            foreach (var item in m_Wrapper.m_ConduciendoActionsCallbackInterfaces)
                UnregisterCallbacks(item);
            m_Wrapper.m_ConduciendoActionsCallbackInterfaces.Clear();
            AddCallbacks(instance);
